  path: string;
  component: React.ComponentType;
}

function App() {
  const token = localStorage.getItem("access_token");
  const navigate = useNavigate();

  useEffect(()=>{
    if(!localStorage.getItem("token")){
      navigate("/login");
    }else{
      getUser();
    }
    },[]);

  return (
    <BrowserRouter>
      <Routes>
        {<Route path="/HomePage" Component={HomePage} /> ? (
          token
        ) : (
          <Route path="/login" Component={Login} />
        )}
      </Routes>
    </BrowserRouter>
  );
}

export default App;
